import React from 'react';
import './App.css';

function App() {
  const popupStyle = {
    backgroundColor: 'rgb(100, 64, 189)',
    width: '30%',
    height: '90vh',
  };

  return (
    <div className="App" style={popupStyle}>
      <p>Hello, your Chrome extension content goes here!</p>
    </div>
  );
}

export default App;
